import './contact.css';
import { LinkedinOutlined, GithubOutlined, MailOutlined } from '@ant-design/icons';

function Contact() {
    return (
        <section id="contact">
          <h2>Contact :</h2>
          <ul>
            <li>LinkedIn</li>
            <li>GitHub</li>
            <li>Mail</li>
          </ul>
        </section>
    );
}

export default Contact;
